import React from "react";
import './email.styles.css';

const EmailCard = ({ email, onClick }) => {
  const { id, from, address, time, subject, read } = email;

  const handleClick = () => {
    onClick(id);
  };

  return (
    <div
      className={`card-container ${read ? 'read' : ''}`}
      onClick={handleClick}
    >
      <h2>{from}</h2>
      <p>{address}</p>
      <p>{time}</p>
      <p>{subject}</p>
    </div>
  );
};

export default EmailCard;
